import React from 'react';
import Home from './home/Home';
import NoMatch from './404/NoMatch';

export const Routes = () => {

  return (
    <Switch>
      <Route exact path="/Home" component={Home} />
      <Route exact path="/">
        <Redirect to ="/Home" />
      </Route>


      <Route component={NoMatch}/>
    </Switch>
  );

};
